"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?42/10/43170?source=see_link\">",
"       Patient information: Angina treatment &mdash; medical versus interventional therapy (Beyond the Basics)",
"      </a>",
"     </p>",
"    </div>",
