" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 502px\">",
"   <div class=\"ttl\">",
"    Effect of amiodarone after MI in EMIAT",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 482px; height: 501px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Effect of amiodarone in 1486 postmyocardial patients who were randomized to amiodarone or placebo. When analyzed by baseline ejection fraction, amiodarone had no effect on all-cause mortality (top panel), but reduced the incidence of arrhythmic death or resuscitated cardiac arrest (bottom panel). The benefit was greatest in patients with an EF &le;30 percent (dashed lines).",
"    <div class=\"footnotes\">",
"     %: percent.",
"    </div>",
"    <div class=\"reference\">",
"     Data from Julian, DG, Camm, AJ, Frangin, G, et al. Lancet 1997; 349:667.",
"    </div>",
"   </div>",
